//+build ignore

package main

import (
	"fmt"
	"go/format"
	"os"
	"strings"
)

func main() {
	newFile := []string{
		"package lang",
		"",
		"// Code generated by go:generate. DO NOT EDIT.",
		"",
		`import "regexp"`,
		"",
	}

	var regexp []string
	for _, char := range specials {
		regexp = append(regexp, fmt.Sprintf("\\x{%x}", char))
	}

	newFile = append(newFile, fmt.Sprintf("var SpecialsRegexp = regexp.MustCompile(`[%s]`)", strings.Join(regexp, "")), "")

	source := []byte(strings.Join(newFile, "\n"))
	source, err := format.Source(source)
	if err != nil {
		panic(err)
	}

	err = os.WriteFile("lang/unicode_special.go", source, os.ModePerm)
	if err != nil {
		panic(err)
	}
}

